package com.example.deisgnapp.materialdesign.recyclerview

import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import androidx.recyclerview.widget.*
import com.example.deisgnapp.R

class RecyclerviewActivity : AppCompatActivity() {

    private val dataModelList=ArrayList<DataModel>()
    private lateinit var adpter:DataAdapter
    private lateinit var recyclerView: RecyclerView
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_recyclerview)

        intiView()
    }

    private fun intiView() {
        recyclerView=findViewById(R.id.recyclerView)
        adpter=DataAdapter(this,dataModelList)

        val layoutManager=LinearLayoutManager(this) //vertical
        //  val layoutManager=LinearLayoutManager(this,LinearLayoutManager.HORIZONTAL,true)

        //val layoutManager=GridLayoutManager(this,2)

       // val layoutManager=StaggeredGridLayoutManager(2,StaggeredGridLayoutManager.VERTICAL)


        recyclerView.layoutManager=layoutManager
        recyclerView.itemAnimator=DefaultItemAnimator()


        recyclerView.adapter=adpter


        addData()
    }

    private fun addData() {
        var dataModel=DataModel("Aashu","IT",450000f,"data:image/png;base64,")
        dataModelList.add(dataModel)

         dataModel=DataModel("Ankit","Developer",15000f,"data:image/png;base64,")
        dataModelList.add(dataModel)

         dataModel=DataModel("Tushar","Programmer",16000f,"data:image/jpeg;base64,")
        dataModelList.add(dataModel)

         dataModel=DataModel("Jack","Design",140000f,"data:image/png;base64,")
        dataModelList.add(dataModel)

         dataModel=DataModel("Roy","Development",20000f,"data:image/jpeg;base64,")
        dataModelList.add(dataModel)

         dataModel=DataModel("Tonny","markting",22000f,"data:image/png;base64,")
        dataModelList.add(dataModel)
    }
}